      <div className="Details">
        <div className="PersonalDetail">
          Jhon Smith<img src="/images/PreVerify.svg" height="30%" width="30%" className="PreVerify" alt=""/>
        </div>
        <div className="Button">
        </div>
      </div>
    </div>
  );
};

export default ImgCard;
